void from_bits(uint8_t bits[BLOCK_SIZE], WORD_TYPE *x1, WORD_TYPE *x2,WORD_TYPE *x3,WORD_TYPE *x4) {
    *x1 = 0;
    *x2 = 0;
    *x3 = 0;
    *x4 = 0;
    for (size_t i = 0; i < WORD_SIZE; i++) {
        *x1 |= ((WORD_TYPE) bits[i]) << i;
        *x2 |= ((WORD_TYPE) bits[WORD_SIZE + i]) << i;
        *x3 |= ((WORD_TYPE) bits[WORD_SIZE*2 + i]) << i;
        *x4 |= ((WORD_TYPE) bits[WORD_SIZE*3 + i]) << i;
    }
}

void to_bits(WORD_TYPE x1, WORD_TYPE x2,WORD_TYPE x3,WORD_TYPE x4, uint8_t bits[BLOCK_SIZE]) {
    for (size_t i = 0; i < WORD_SIZE; i++) {
        bits[i] = (x1 >> i) & 1;
        bits[WORD_SIZE + i] = (x2 >> i) & 1;
        bits[WORD_SIZE*2+i] = (x3 >> i) & 1;
        bits[WORD_SIZE*3+i] = (x4 >> i) & 1;
        bits[WORD_SIZE*4+i] = 0;
        bits[WORD_SIZE*5+i] = 0;
    }
}

void matrix_vector_product(uint8_t matrix[BLOCK_SIZE][BLOCK_SIZE], uint8_t x[BLOCK_SIZE], uint8_t res[BLOCK_SIZE]) {
    for (size_t i = 0; i < BLOCK_SIZE; i++) {
        for (size_t j = 0; j < BLOCK_SIZE; j++) {
            res[i] ^= matrix[i][j] * x[j];
        }
    }
}

void vector_addition(uint8_t vector[BLOCK_SIZE], uint8_t x[BLOCK_SIZE]) {
    for (size_t i = 0; i < BLOCK_SIZE; i++) {
        x[i] ^= vector[i];
    }
}

void modular_addition(uint8_t x[BLOCK_SIZE]) {
    uint8_t carry = 0;
    for (size_t i = 0; i < WORD_SIZE; i++) {
        x[i] = x[i] + x[WORD_SIZE + i] + carry;
        carry = x[i] > 1;
        x[i] &= 1;
    }
}

void encrypt(WORD_TYPE p[4], WORD_TYPE c[4]) {
    uint8_t x[BLOCK_SIZE];
    uint8_t res[BLOCK_SIZE];
    to_bits(p[0], p[1], p[2], p[3], x);
    for (size_t i = 0; i < ROUNDS; i++) {
        memset(&res, 0, BLOCK_SIZE * sizeof(uint8_t));
        matrix_vector_product(MATRICES[i], x, res);
        vector_addition(VECTORS[i], res);
        
        memcpy(&x, &res, BLOCK_SIZE * sizeof(uint8_t));
    }

    memset(&res, 0, BLOCK_SIZE * sizeof(uint8_t));
    matrix_vector_product(MATRICES[ROUNDS], x, res);
    vector_addition(VECTORS[ROUNDS], res);
    from_bits(res, &c[0], &c[1],&c[2],&c[3]);
}

